  `empty_box_call_address` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '空箱上门地址（订单状态为1-5，显示）',
  `empty_box_call_time` date NOT NULL COMMENT '空箱上门时间（年月日，订单状态为1-5，显示）',
  `empty_box_call_interval` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '空箱上门时段（如09:00-13:00，订单状态为1-5，显示）',
  `heavy_box_call_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '重箱提取姓名（订单状态为6-10，显示）',
  `heavy_box_call_phone` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '重箱提取电话（订单状态为6-10，显示）',
  `heavy_box_call_address` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '重箱提取地址（订单状态为6-10，显示）',
  `heavy_box_call_time` date NULL DEFAULT NULL COMMENT '重箱提取时间（年月日，订单状态为6-10，显示）',
  `heavy_box_call_interval` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '重箱提取时段（如09:00-13:00，订单状态为6-10，显示）',
  `box_id` bigint(20) UNSIGNED NOT NULL COMMENT '箱子id',
  `box_code` bigint(20) UNSIGNED NOT NULL COMMENT '箱子编号（年月日+6位序列）',
  `box_standard` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '箱子规格（如20*20*20）',
  `box_unit_price` bigint(20) UNSIGNED NOT NULL COMMENT '箱子积分单价（每月积分单价）',
  `lease_duration` int(10) UNSIGNED NOT NULL COMMENT '租赁时长（月）',
  `total_price` bigint(20) UNSIGNED NOT NULL COMMENT '实付积分',
  `sort_no` bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '序号',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `create_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '创建人',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '更新人',
  `version` bigint(20) UNSIGNED NOT NULL COMMENT '版本号',
  `del_flag` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '删除标记（0：未删除；2：已删除）',
  `app_del_flag` tinyint(3) UNSIGNED NOT NULL COMMENT '手机端删除标记（0：未删除；2：已删除）',
  `backend_del_flag` tinyint(3) UNSIGNED NOT NULL COMMENT '后台端删除标记（0：未删除；2：已删除）',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_user_id`(`user_id`) USING BTREE,
  INDEX `idx_status`(`status`) USING BTREE,
  INDEX `idx_box_id`(`box_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 23 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单表' ROW_FORMAT = Dynamic;

